pragma solidity ^0.6.6;

import "./DeckNFTBase.sol";

contract DeckNFT is DeckNFTBase {
    string public defaultURI;

    constructor(
        uint256 _mintFeePerToken,
        uint256 _maxDeck,
        string memory _defaultURI
    )
        public
        DeckNFTBase(_mintFeePerToken, _maxDeck)
    {
      defaultURI = _defaultURI;
    }

    function baseTokenURI() public view returns (string memory) {
        return defaultURI;
    }

    function setDefaultURI(string memory _defaultURI) public onlyOwner {
        defaultURI = _defaultURI;
    }


    function tokenURI(uint256 _optionId) public view virtual override returns (string memory) {
        return string(abi.encodePacked(defaultURI, Strings.toString(_optionId)));
    }

    /**
     * @dev mint `numberToken` for msg.sender aka who call method.
     * @param numberToken number token collector want to mint
     */
    function _mintDeck(uint256 numberToken) internal returns (bool) {
        for (uint256 i = 0; i < numberToken; i++) {
            uint256 tokenIndex = totalSupply();
            if (tokenIndex < MAX_DECK) _safeMint(_msgSender(), tokenIndex);
        }
        return true;
    }

    function mintDeck(uint256 numberToken)
        public
        payable
        online
        mintable(numberToken, totalSupply())
        returns (bool)
    {
        return _mintDeck(numberToken);
    }
}
